import React from "react";
import styled from "styled-components";

const Div = styled.div`
  display: flex;
  flex-direction: column;
  align-items: center;
  margin: 0 auto;

  border-left: 1px solid black;
  border-right: 1px solid black;
  max-width: 1200px;
`;

const Index = () => {
  return (
    <Div>
      <p>hi</p>
    </Div>
  );
};

export default Index;
